import React, { Component } from "react";

export default class DialogResult extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    let { result } = this.props;
    let stringResult = JSON.stringify(result);
    return <div className="dialog__result">{stringResult}</div>;
  }
}
